import React from "react";
import { Card, Row, Col } from "reactstrap";
import Footer from "./Footer";

const Date = () => {
  return (
    <>
      <Row>
        <Col>
          <Card className="kartu3 card">
            <div>
              <h2>Date</h2>
            </div>
          </Card>
          <Footer />
        </Col>
      </Row>
    </>
  );
};

export default Date;
